import React from "react";
import "@coreui/coreui/dist/css/coreui.min.css";
import {
    CNavbar,
    CContainer,
    CNavbarBrand,
    CNavLink,
    CNavbarToggler,
    COffcanvas,
    COffcanvasHeader,
    COffcanvasTitle,
    CButton,
    CFormInput,
    CForm,
    CNavItem,
    CDropdownItem,
    CDropdownDivider,
    CDropdownMenu,
    CDropdownToggle,
    CDropdown,
    CNavbarNav,
    COffcanvasBody,
    CCloseButton,
  } from "@coreui/react";
const Login = () => {
  return (
  <>
  
  Microsoft Teams
  Meet chat and collaborate in one place
  <CButton color="primary" type="submit">Sign in</CButton>
  </>
  );
};

export default Login;
